async def init():
    # 创建文件夹存放 json 数据
    if path.Path("dist").exists():
        # do nothing
        pass
    else:
        path.Path("dist").mkdir()
    today = date.today()
    # 格式化为 "YYYYMMDD" 的字符串
    formatted_date = today.strftime("%Y%m%d")
    if path.Path("dist/" + formatted_date + ".json").exists():
        # 读取文件
        file = open("dist/" + formatted_date + ".json", "r")
        content = file.read()
        file.close()
        return json.loads(content)
    else:
        # 写入文件
        async def fetch_and_save_data():
            data = await get_data()
            with open("dist/" + formatted_date + ".json", "w") as f:
                json.dump(data, f)
            return data
        
        return await fetch_and_save_data()

def calculate_festival():
    """计算节日"""
    today = date.today()

    year_now = today.year
    month_now = today.month
    day_now = today.day

    # 各个节日
    festivals = {
        "元旦":"1-1",
        "清明":"4-4",
        "劳动":"5-1",
        "儿童":"6-1",
        "建军":"8-1",
        "国庆":"10-1"
    }
    
    t = {}

    for festival, date_str in festivals.items():
        month,day = date_str.split("-")

        if int(month) > month_now:
            # 月份比当前大，说明是今年的
            # 时间是明年的

            time = date(year_now, int(month), int(day))

            days = (time - today).days
            t[festival] = days
        if int(month) < month_now:
            # 时间是明年的
            time = date(year_now+1, int(month), int(day))

            days = (time - today).days
            t[festival] = days
        if int(month) == month_now:
            if int(day) > day_now:
                # 时间是今年的
                time = date(year_now, int(month), int(day))

                days = (time - today).days
                t[festival] = days
            if int(day) < day_now:
                # 时间是明年的
                time = date(year_now+1, int(month), int(day))

                days = (time - today).days
                t[festival] = days
            else:
                t[festival] = 0
    
    return t
    
async def get_data():
    """
    获取所有数据并返回字典。
    """
    one = await get_one()
    s = await get_60s()
    anime = await get_anime()
    bili = await get_bili()
    return {
        "one": one,
        "60s": s,
        "anime": anime,
        "bili": bili
    }

def rgb_to_hex(rgb):
    """
    将 RGB 元组转换为 HEX 颜色字符串。
    
    参数:
        rgb (tuple): RGB 颜色元组，例如 (102, 204, 255)。
    
    返回:
        str: HEX 颜色字符串，例如 "#66ccff"。
    """
    return '#{:02x}{:02x}{:02x}'.format(*rgb)

def download_file(url, save_path):
    # 发送 HTTP GET 请求
    response = requests.get(url, stream=True)

    # 检查请求是否成功
    if response.status_code == 200:
        # 以二进制模式写入文件
        with open(save_path, 'wb') as file:
            for chunk in response.iter_content(chunk_size=8192):
                file.write(chunk)
        print(f"文件已下载到: {save_path}")
    else:
        print(f"下载失败，状态码: {response.status_code}")

def calculate_md5(data):

    # 创建 MD5 哈希对象
    md5_hash = hashlib.md5()

    # 更新哈希对象（需要将字符串编码为字节）
    md5_hash.update(data.encode('utf-8'))

    # 获取哈希值（十六进制表示）
    hash_value = md5_hash.hexdigest()

    # 返回哈希值（十六进制表示）
    return hash_value


def handle_anime(data:dict = Body(...)):
    """处理动漫数据"""
    s = {}
    for i in range(0,len(data['items'])):
        name = calculate_md5(data['items'][i]['images']['large'])

        key = data['items'][i]['name'] if data["items"][i]["name_cn"] =="" else data["items"][i]["name_cn"]

        if path.Path(f'dist/{name}.jpg').exists():
            s[key ] = f'dist/{name}.jpg'
        else:
            download_file(data['items'][i]['images']['large'], f"dist/{name}.jpg")
            s[key] = f'dist/{name}.jpg'
    
    return s
    
def darken_color(hex_color, factor=0.7):
    """
    将 HEX 颜色变深。
    
    参数:
        hex_color (str): HEX 颜色字符串，例如 "#66ccff"。
        factor (float): 变深系数，0 < factor < 1。默认值为 0.7。
    
    返回:
        str: 变深后的 HEX 颜色字符串。
    """
    # 将 HEX 转换为 RGB
    b,g,r = hex_to_bgr(hex_color)
    
    # 调整 RGB 值的亮度
    r = int(r * factor)
    g = int(g * factor)
    b = int(b * factor)
    
    # 确保值在 0-255 范围内
    r = max(0, min(r, 255))
    g = max(0, min(g, 255))
    b = max(0, min(b, 255))
    
    # 将 RGB 转换回 HEX
    return rgb_to_hex((r, g, b))


async def fetch_data(url: str):
    async with httpx.AsyncClient() as client:
        try:
            response = await client.get(url)
            response.raise_for_status()  # 检查响应状态码
            return response.json()  # 返回 JSON 数据
        except httpx.HTTPStatusError as e:
            raise HTTPException(status_code=e.response.status_code, detail=str(e))

